import { Fragment, useEffect } from "react";

const ProductList = (props) => {
    
    const product = { id: 5, name: 'M1 MacBook', description: 'Best MacBook on the Market', price: 3699 }
    
    useEffect( () => {
        console.log(product);
    })

    return (
        <div>
            Product List Here
        </div>
    )
}

export default ProductList;
